import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import SuperAdminDashboard from './components/SuperAdminDashboard';
import HospitalAdminDashboard from './components/HospitalAdminDashboard';
import AdminDashboard from './components/AdminDashboard';
import DashboardOverview from './components/DashboardOverview';
import DoctorManagement from './components/DoctorManagement';
import NurseManagement from './components/NurseManagement';
import Scheduling from './components/Scheduling';
import './App.css';

const App: React.FC = () => {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/super-admin-dashboard" element={<SuperAdminDashboard />} />
          <Route path="/hospital-admin-dashboard" element={<HospitalAdminDashboard />} />
          <Route path="/admin" element={<AdminDashboard />}>
            <Route index element={<DashboardOverview />} />
            <Route path="doctors" element={<DoctorManagement />} />
            <Route path="nurses" element={<NurseManagement />} />
            <Route path="scheduling" element={<Scheduling />} />
          </Route>
          <Route path="/" element={<Navigate to="/admin" replace />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
